window.bookSummaryJSON = "<p><b>Narrated by best-selling rom-com duo Erin Mallon and Teddy Hamilton! </b></p> <p>Dean is certain that fake dating the cute owner of his new bakery investment could be messy...but messy can be fun.</p> <p>Norah Donahue wants bakeries, not babies, but her matchmaking mother won't stop trying to play Cupid.</p> <p>Dean Moser is a cocky stock market savant whose friends are all settling down, leaving Boulder's infamous ladies' man all alone.</p> <p>When Norah needs a fake date for her parents' anniversary party, her new silent investor is the perfect guy for the job. It seems like a foolproof plan....</p> <p>That is until Norah decides to break her biggest rule and lock lips with Dean in the middle of the party to spite her meddling mother.</p> <p>Turns out that Dean and Norah's chemistry is sizzling hot, and mixing business with pleasure could turn out to be a recipe for disaster.</p> <p>Or maybe they can have their cake and eat it, too.</p>"; 
